commit_message:
Remove polish translation Remove link to polish translation as it's outdated ( last commit from 2-3 years ago ). 
For example in polish translation you can read that you should use one "var" keyword to declare your vars.
example:
```js
// Åºle ( bad )
var items = getItems();
var goSportsTeam = true;
var dragonball = 'z';

// dobrze ( good )
var items = getItems(),
    goSportsTeam = true,
    dragonball = 'z';
```

[eslint config] [base] [patch] `newline-per-chained-call`: bump the limit to 4. Specifically, this is to allow this frequent pattern:
```js
$.ajax({
  â¦
}).done(() => {
  â¦
}).fail(() => {
  â¦
}).always(() => {
  â¦
