```

Fix PR comments - Space between function name and args;
- use `render(){}` syntax in object literal;
- Fix link to section;

I abhor switch statements, but their indentation should be: ```js
switch (foo) {
  case 'bar':
    break;
}
```

not what the plugin currently requires:
```js
switch (foo) {
case: 'bar':
  break;
}
```

eslint: Add missing `space-before-keywords` rule All examples in README.md seem to agree on avoiding missing whitespaces
before keywords such as:

    if (cond) {
    }else {       // no space before 'else'
    }

    try {
    }catch (e) {  // no space before 'catch'
    }

This patchs adds the `space-before-keywords` rule as an error (as is
`space-after-keywords` already).

Allow reserved words as keys in ES6 module context `<script type="module">` and *node*/*iojs* code imply full support of ES5.

Code transpiled by *babel* is also perfecly safe:

```js
$ cat <<âââ | babel
const superman = {
  default: { clark: 'kent' },
  private: true
};
âââ
"use strict";

var superman = {
   "default": { clark: "kent" },
   "private": true
};
```

String concat code blocks were not equivalent. If the array is empty, the "bad" code will return `<ul></ul>` and the "good" code will return `<ul><li></li></ul>`.

Although I would prefer this over the for loop:

